import React from "react";
import { Formik } from "formik";

export default function NoteForm(props) {
  return (
    <div>
      <Formik
        initialValues={{
          id: "",
          title: "",
          description: "",
          category: "",
        }}
        onSubmit={props.handleSubmittedNote}
      ></Formik>
    </div>
  );
}
